@davisp @jiangphcn Apologies if I missed that we were mirroring `_dbs_info` in our API. That makes things a bit clearer around use of `key`. Flipping between internal structures (`DbInfo`) and external APIs (`/_dbs_info`) probably got in the way of my understanding.

I didn't particularly think `_all_dbs` was that useful, but it seemed like we were not following any particular pattern so I just picked the one that required me to type fewest characters to demonstrate the idea (an idea which doesn't make much sense now I understand the motivation behind the older API, which I'm not sure anyone really spelled out in the mailing list or here before now, but I probably missed something somewhere 😞 ).

Anyway, I think we've reached a decent stopping point here (given that I think mostly I've just got everyone to justify an already good solution tbh rather than moving us forward), so let's move forward and not make @jiangphcn implement yet another thing 😉 Nice work all in all.

@cefn Hey Cefn, thanks for the request.

FYI CouchDB 3.0.0 now ships with SM60 support. We no longer build SM60 ourselves, except for Windows, relying on the version provided by the distribution (Linux). I believe we use a brew recipe on macOS. You'll need to take it up with the packagers (e.g., Debian, RedHat, Ubuntu, etc.) if you want them to provide a SpiderMonkey REPL in their packages. It looks like, right now, you can get that from `libmozjs-60-dev` via `/usr/bin/js60`.

As we don't intend to put any more effort into SM 1.8.5 at this point, I'm going to close this as a wontfix.

@wohali Any ideas on this issue? I noticed you created a bug for a similar issue about two years ago. 
#1356
#https://github.com/apache/couchdb/issues/1356

I updated the PR to meck the view write function so we can assert  that the index is not actually updated. 

I had also noticed that sometimes when we return from `wait_for_job/4` https://github.com/apache/couchdb/blob/30fdef77571c67c945d70fb54c07157c4643f828/src/couch_views/src/couch_views_jobs.erl#L94 when we query, the job could still running since we check the ViewSeq and UpdateSeq only in the data then unsubscribe. https://github.com/apache/couchdb/blob/30fdef77571c67c945d70fb54c07157c4643f828/src/couch_views/src/couch_views_jobs.erl#L118. So I added a function to also ensure the job is finished. This is to make the test is more deterministic.

@tonysun83 good question about how to trigger that retry line. I think it would have to be something like a job with the old (now deleted ddoc) was running when the client with the current (not-deleted) doc id started the query. Then the job with the deleted doc would crash with the `ddoc_deleted` error, the client with the current ddoc would get the error and then `retry`. On retry, it will re-add the job which, if it is in a `pending` or `finished` state now update it with the non-deleted design doc id.
